import Layout from '../components/Layout'
import Head from 'next/head'

export default function About() {
    return (      
      <div>
           <Head>
            <title>Projects</title>
        </Head>
        <Layout />
        <p>This is the about page</p>
        <p>This is the about page</p>
        <p>This is the about page</p>
        <p>This is the about page</p>
        <p>This is the about page</p>
        <p>This is the about page</p>
        <div className="gradient-border" id="box">Animated Gradient Border</div>


        <style jsx>{`
        @import url('https://fonts.googleapis.com/css?family=Raleway:200');

        html, body {
          height: 100%;
        }
        body {
          display: flex;
          justify-content: center;
          align-items: center;
          height: 100%;
          background: white;
        }
        #box {
          display: flex;
          align-items: center;
          justify-content: center;
          width: 400px;
          height: 200px;
          color: black;
          font-family: 'Raleway';
          font-size: 2.5rem;
        }
        .gradient-border {
          --borderWidth: 3px;
          background: white;
          position: relative;
          border-radius: var(--borderWidth);
        }

        
        
        @keyframes animatedgradient {
          0% {
            background-position: 0% 50%;
          }
          50% {
            background-position: 100% 50%;
          }
          100% {
            background-position: 0% 50%;
          }
        }
        
          
        `} </style>
      </div>
    );
  }
